import React, { useState, useEffect } from 'react';
import { Chart } from 'react-chartjs-2';
import { Pie, Line } from 'react-chartjs-2';
import axios from 'axios';
import './ExpenseTracker.css'; // Optional: For styling

const ExpenseTracker = () => {
  const [expenses, setExpenses] = useState([]);
  const [amount, setAmount] = useState('');
  const [category, setCategory] = useState('Food');
  const [date, setDate] = useState(new Date().toISOString().split('T')[0]); // Set current date
  const [totalExpense, setTotalExpense] = useState(0);
  const [nextDate, setNextDate] = useState('');
  const [trendsData, setTrendsData] = useState([]);
  const [categoryData, setCategoryData] = useState({});

  useEffect(() => {
    fetchExpenses();
  }, []);

  const fetchExpenses = async () => {
    const response = await axios.get('/api/expenses'); // Fetch expenses from backend
    setExpenses(response.data);
    calculateTotal(response.data);
    calculateTrends(response.data);
    calculateCategoryData(response.data);
  };

  const calculateTotal = (data) => {
    const total = data.reduce((sum, expense) => sum + expense.amount, 0);
    setTotalExpense(total);
  };

  const calculateTrends = (data) => {
    const trends = {}; // Collect data for trends analysis
    data.forEach(expense => {
      const date = expense.date.split('T')[0]; // Use date only (remove time)
      if (!trends[date]) trends[date] = 0;
      trends[date] += expense.amount;
    });
    setTrendsData(trends);
  };

  const calculateCategoryData = (data) => {
    const categoryTotals = {}; // Collect category data
    data.forEach(expense => {
      if (!categoryTotals[expense.category]) categoryTotals[expense.category] = 0;
      categoryTotals[expense.category] += expense.amount;
    });
    setCategoryData(categoryTotals);
  };

  const handleAddExpense = async () => {
    if (!amount || !category) return; // Validation
    const newExpense = { amount: parseFloat(amount), category, date };
    await axios.post('/api/expenses', newExpense); // Send new expense to backend
    fetchExpenses(); // Refresh expenses list
    setAmount(''); // Reset input fields
    setCategory('Food');
  };

  const handleNextDate = () => {
    setDate(nextDate);
    setNextDate('');
  };

  const trendChartData = {
    labels: Object.keys(trendsData),
    datasets: [{
      label: 'Daily Expenses',
      data: Object.values(trendsData),
      borderColor: 'rgba(75,192,192,1)',
      backgroundColor: 'rgba(75,192,192,0.2)',
    }],
  };

  const categoryChartData = {
    labels: Object.keys(categoryData),
    datasets: [{
      data: Object.values(categoryData),
      backgroundColor: [
        '#FF6384',
        '#36A2EB',
        '#FFCE56',
        '#4BC0C0',
      ],
    }],
  };

  return (
    <div className="expense-tracker">
      <h2>Expense Tracker</h2>
      <div className="input-section">
        <input
          type="date"
          value={date}
          onChange={(e) => setDate(e.target.value)}
        />
        <input
          type="number"
          placeholder="Amount"
          value={amount}
          onChange={(e) => setAmount(e.target.value)}
        />
        <select value={category} onChange={(e) => setCategory(e.target.value)}>
          <option value="Food">Food</option>
          <option value="Accommodation">Accommodation</option>
          <option value="Travel">Travel</option>
          <option value="Other">Other</option>
        </select>
        {category === 'Other' && (
          <input
            type="text"
            placeholder="Specify category"
            onChange={(e) => setCategory(e.target.value)}
          />
        )}
        <button onClick={handleAddExpense}>Add Expense</button>
        <button onClick={handleNextDate}>Next Date</button>
      </div>
      <div className="summary">
        <h3>Total Expenses: ${totalExpense.toFixed(2)}</h3>
      </div>
      <div className="charts">
        <div className="chart">
          <h3>Spending Trend Analysis</h3>
          <Line data={trendChartData} />
        </div>
        <div className="chart">
          <h3>Category Wise Breakdown</h3>
          <Pie data={categoryChartData} />
        </div>
      </div>
      <div className="tips">
        <h3>Tips:</h3>
        <ul>
          <li>Track your expenses daily for better insights.</li>
          <li>Set a budget for each category to control spending.</li>
          <li>Review your spending patterns regularly.</li>
        </ul>
      </div>
    </div>
  );
};

export default ExpenseTracker;
